  false,\n\t\"url\": null,\n\t\"notes\": \"WDCA Chernobyl Data consists of digital
  data set DSI-9681, archived at the National Centers for Environmental Information
  (NCEI). World Data Center for Meteorology (WDC-A), located in Asheville, North Carolina,
  is a meteorological data center in a worldwide network of data centers for the various
  sciences established to promote international exchange of scientific data. This
  particular dataset consists of meteorological data from the April 1986 disaster
  at the Chernobyl nuclear power plant in the Ukraine. Upper air observations may
  include: winds, dew points, and temperatures. Surface observations may include:
  temperatures, winds, humidity, pressure, water vapor, solar radiation, salinity,
  currents, sea ice, swells, and waves. Drifting buoy observations may include: sea
  surface temperature, salinity, currents, swells, and waves. Satellite sounding observations
  may include: thickness, precipitable water, or mean temperature for up to two vertical
  layers.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
